column8:
【プリウス30系　USB/シガーソケット増設キット】<br>
シガーソケットとUSBコネクタを各2個増設！<br>
<br>
■コンソール下部に12V/120Wのシガーソケットが2個と、USBコネクタが2個増設可能。
（USBコネクタは、iPad対応。）<br><br>
■ブルーLED常時点灯で視認性UP！ACC連動で暗い場所や夜間でも、
ブルーLED内蔵でソケットリングとコネクタ内部が鮮やかに発光。フロントコンソールトレイを華やかに
演出します。<br><br>
■選べるカラーバリエーション！純正内装色の色調・質感をリアルに再現！装着後も違和感なし。内装色に
合わせてお選び頂けます。
<hr>
【セット内容】<br>
本体×1、電源用配線、エレクトロタップ×2、取付説明書<br>
<br>
【パネルカラー】<br>
ブラック<br><br>







